import React, { Component } from 'react';

import MeuCarrossel from './MeuCarrossel.js';

class CarrosselProjetos extends Component {
  render() {
    return (
      <div className="row">
        <div className="col">
          <b>Meus Projetos</b>
          <MeuCarrossel/>
        </div>
       
      </div>
    );
  }
}

export default CarrosselProjetos;
